import React from 'react';
import { useNavigate } from 'react-router-dom';

function MyApp() {
  let navigate = useNavigate();

  function handleClick() {
    navigate('/druga-stranica'); // Ovdje upiši putanju do stranice na koju želiš preusmjeriti korisnika
  }

  return <button onClick={handleClick}>Idi na drugu stranicu</button>;
}

export default MyApp;
